import Link from 'next/Link'

const Index = () => {
    return (
        <>
            <nav>
                <Link href={'/'}><a>Home</a></Link>
                <Link href={'/about'}><a>About</a></Link>
                <Link href={'/contact'}><a>Contact Me</a></Link>
            </nav>

            <h1>Hello, this is the index page.</h1>
        </>
    )
};
export default Index;
